import React, { useState } from 'react';
import './Profile.css';
import VerticalNav from '../components/VerticalNav/VerticalNav';
import ActivityChart from '../components/charts/ActivityChart/ActivityChart';
import AverageSessionsChart from '../components/charts/AverageSessionsChart/AverageSessionsChart';
import NutritionalInfo from '../components/charts/NutritionalInfo/NutritionalInfo';
import RadarChart from '../components/charts/PerformanceChart/RadarChart';
import ScoreChart from '../components/charts/ScoreChart/ScoreChart';
import { useFetch } from '../hooks/useFetch';

const BASE_URL = 'http://localhost:3000/user';

const Profile = () => {
  const [userId, setUserId] = useState('18');

  const {
    isLoading: isLoadingUserData,
    apiData: userData,
    mockedData: mockedUserData,
    errorAPI: errorUserDataAPI,
    errorMocked: errorUserDataMocked
  } = useFetch(`${BASE_URL}/${userId}`, userId, 'path/to/mockUserData.json');

  const {
    isLoading: isLoadingUserActivity,
    apiData: userActivity,
    mockedData: mockedUserActivity,
  } = useFetch(`${BASE_URL}/${userId}/activity`, userId, 'path/to/mockUserActivity.json');

  const {
    isLoading: isLoadingUserAverageSessions,
    apiData: userAverageSessions,
    mockedData: mockedUserAverageSessions,
  } = useFetch(`${BASE_URL}/${userId}/average-sessions`, userId, 'path/to/mockUserAverageSessions.json');

  const {
    isLoading: isLoadingUserPerformance,
    apiData: userPerformance,
    mockedData: mockedUserPerformance,
  } = useFetch(`${BASE_URL}/${userId}/performance`, userId, 'path/to/mockUserPerformance.json');

  const handleUserChange = (newUserId) => {
    setUserId(newUserId);  
  };

  if (isLoadingUserData || isLoadingUserActivity || isLoadingUserAverageSessions || isLoadingUserPerformance) {
    return <div>Chargement...</div>;
  }

  if ((errorUserDataAPI && errorUserDataMocked) || !userData && !mockedUserData) {
    return <div>Erreur de chargement des donn√©es utilisateur</div>;
  }

  const userInfos = userData?.userInfos || mockedUserData?.userInfos;
  const keyData = userData?.keyData || mockedUserData?.keyData;
  const activitySessions = userActivity?.sessions || mockedUserActivity?.sessions;
  const averageSessions = userAverageSessions?.sessions || mockedUserAverageSessions?.sessions;
  const performanceData = userPerformance?.data || mockedUserPerformance?.data;
  const score = userData?.score || userData?.TodayScore || mockedUserData?.score || mockedUserData?.TodayScore;

  if (!userInfos || !keyData || !activitySessions || !averageSessions || !performanceData) {
    return <div>Donn√©es non disponibles</div>;
  }

  const { firstName } = userInfos;

  return (
    <div className="profile-container">
      <VerticalNav userId={userId} onUserChange={handleUserChange} />

      <div className="profile-header-section">
        <div className="profile-header">
          <h1>Bonjour <span className="user-name">{firstName}</span></h1>
          <p>F√©licitation ! Vous avez explos√© vos objectifs hier üëè</p>
        </div>
        
        <div className="section-activity">
          <ActivityChart data={activitySessions} />
        </div>

        <div className="trois-sections">
          <div className="section">
            <AverageSessionsChart data={averageSessions} />
          </div>

          <div className="section">
            <RadarChart data={performanceData} />
          </div>

          <div className="section">
            <ScoreChart data={{ score }} />
          </div>
        </div>
      </div>

      <div className="sections">
        <NutritionalInfo
          calorieCount={keyData.calorieCount}
          proteinCount={keyData.proteinCount}
          carbohydrateCount={keyData.carbohydrateCount}
          lipidCount={keyData.lipidCount}
        />
      </div>
    </div>
  );
};

export default Profile;
